class Solution:
    def strStr(self, haystack: str, needle: str) -> int:
        if not needle:
            return 0
        if len(needle) == len(haystack) and haystack == needle:
            return 0
        for i in range(0, len(haystack) - len(needle) + 1):
            if haystack[i:i + len(needle)] == needle:
                return i
        return -1
#    abcdefg     fg
s = Solution()
print(s.strStr("abcdefg", "fg"))
